    return(
        <div className={Style.WholeCover}>
            <div className={Style.likeSettingCover}>
                
            </div>
            <div className={Style.commentSettingCover}>

            </div>
            <div className={Style.readPageSettingCover}>

            </div>
            <div className={Style.readCommentSettingCover}>

            </div>
            <div className={Style.writeCommentSettingCover}>

            </div>
            <div className={Style.readLikeSettingCover}>

            </div>
        </div>
    );
}

export default RightNewPost
